import React from 'react'

const Footer = () => {
  return (
    <footer>
        <p>Copyright 2023 - Del Castillo, Luis Javier.</p>

        <p><img src="./images/DH.png" alt='DH-logo' /></p>
    </footer>
  )
}

export default Footer
